import {NavLink} from 'react-router-dom';
import styles from './Header.module.css';

const Header = () => {
    return (
        <>
          <NavLink to="/people" exact>People</NavLink>
          <NavLink to="/" exact>Home</NavLink>
        </>
    );
}

// Header.propTypes = {
